    info: "From the dirt-poor alleys of Anderson Indiana to a record breaking career on the legendary team on the grandest stage in sports Carl Erskine has lived the American dream and spent a lifetime giving to others. His life as a famed Brooklyn Dodger and human rights advocate is featured in this inspiring new documentary The Best We Have Got The Carl Erskine Story which will premiere August 11. Directed and produced by award winning filmmaker Ted Green the documentary shares the inspiring story of Erskine and the pivotal role he played in two of the great human rights movements of our time. He helped break down racial barriers as a teammate and close friend of Jackie Robinson and fought for people with intellectual disabilities their acceptance and the services available to them. As the last living member of the Brooklyn Dodgers Boys of Summer the 95 year old Erskine played in five World Series set the Series single game strikeout record threw two no hitters.",
