    info: "Join Cary Elwes (Westley) for a behind-the-scenes look at life on & off the set of the classic film, The Princess Bride. After a screening of the iconic movie, Elwes will engage in a moderated discussion revealing never before shared secrets & tales of inconceivable antics! Journey back to the lands of Florin & Guilder in an adventure filled with fencing, fighting, torture, revenge, giants, monsters, chases, escapes, miracles, & of course, true love. Elwes has been in a multitude of films & TV shows, including Robin Hood: Men in Tights, Bram Stokers Dracula, Saw, Twister, Liar, Liar, Stranger Things & The Marvelous Mrs. Maisel. He recently starred in Guy Ritchies Five Eyes & just wrapped Mission Impossible 7 with Tom Cruise. Now, Elwes is hitting the road to share w fans the personal stories behind the making of this piece of cinematic history. Dont be a Humperdinck, make haste to see The Princess Bride: An Inconceivable Evening w/ Cary Elwes for a night you will always tweasure.",
